import React from 'react';
import { StyleSheet} from 'react-native';

export const styles = StyleSheet.create({
  store:{
    marginTop:17,
    height:40,
    width:40,
  },
  img2:{
    marginTop:30,
    height:100,
    width:100,
  },
  img3:{
    height:50,
    width:70,
  },
  buttonContainer:{
    width: 90,
    height: 90,
    backgroundColor: '#9ADAD6',
    borderRadius: 15,
    alignItems: 'center',
  },
  buttonContainer2:{
    width: 90,
    height: 90,
    backgroundColor: '#196F75',
    borderRadius: 15,
    alignItems: 'center',
  },
  buttonContainer3:{
    width: 90,
    height: 90,
    backgroundColor: '#FF816B',
    borderRadius: 15,
    alignItems: 'center',
  },
  buttons:{
    flexDirection: 'row',
    justifyContent: 'space-around',
  },
  searchBar: {
    flex:1,
    width: 315,
    height: 35,
    borderRadius: 15,
  },
  home: {
    flex:1,
    width: 315,
    height: 210,
    background: '#ffffff',
    borderRadius: 15,
  }
});
